### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Linear Transformations
- **Definition**: A function \( T: \mathbb{R}^n \to \mathbb{R}^m \) that preserves vector addition and scalar multiplication.
- **Properties**: Injectivity, surjectivity, bijectivity.
- **Matrix Representation**: A linear transformation can be represented by a matrix \( A \) such that \( T(x) = Ax \).
- **Rank and Nullity**: For a linear transformation \( T \), rank is the dimension of the image of \( T \), and nullity is the dimension of the kernel of \( T \).

#### 2. Vector Spaces and Subspaces
- **Definition**: A set of vectors closed under addition and scalar multiplication.
- **Basis and Dimension**: A basis is a set of linearly independent vectors that span the space. The dimension is the number of vectors in the basis.
- **Affine Subspaces**: Translations of vector subspaces.

#### 3. Orthonormal Basis and Projections
- **Orthonormal Basis**: A set of vectors that are both orthogonal and unit vectors.
- **Projection**: The projection of a vector \( v \) onto a subspace \( W \) is the closest vector in \( W \) to \( v \).

#### 4. Gram-Schmidt Process
- **Process**: A method for orthonormalizing a set of vectors in an inner product space.
- **Application**: Used to find an orthonormal basis for a subspace.

#### 5. Matrix Algebra
- **Rank of a Matrix**: The maximum number of linearly independent row or column vectors.
- **Invertibility**: A matrix is invertible if there exists another matrix such that their product is the identity matrix.
- **Similarity**: Two matrices are similar if they represent the same linear transformation under different bases.

### Equations

#### Linear Transformation
\[ T: \mathbb{R}^n \to \mathbb{R}^m \]
\[ T(x) = Ax \]

#### Rank and Nullity
\[ \text{rank}(T) + \text{nullity}(T) = n \]

#### Projection
\[ P_W(v) = \text{proj}_W v \]

#### Gram-Schmidt Process
\[ u_1 = v_1 \]
\[ u_2 = v_2 - \text{proj}_{u_1} v_2 \]
\[ u_k = v_k - \sum_{i=1}^{k-1} \text{proj}_{u_i} v_k \]

#### Matrix Invertibility
\[ A^{-1}A = AA^{-1} = I \]

